        /// <param name="xy">The constructed vector's xy components will be set to this value.</param>
        /// <returns>ushort2 constructed from arguments.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort2 ushort2(ushort2 xy) { return new ushort2(xy); }

        /// <summary>Returns a ushort2 vector constructed from a single ushort value by assigning it to every component.</summary>
        /// <param name="v">ushort to convert to ushort2</param>
        /// <returns>Converted value.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort2 ushort2(ushort v) { return new ushort2(v); }

        /// <summary>Returns a uint hash code of a ushort2 vector.</summary>
        /// <param name="v">Vector value to hash.</param>
        /// <returns>uint hash of the argument.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static uint hash(ushort2 v)
        {
            return csum(asuint(v) * uint2(0x4473BBB1u, 0xCBA11D5Fu)) + 0x685835CFu;
        }

        /// <summary>
        /// Returns a uint2 vector hash code of a ushort2 vector.
        /// When multiple elements are to be hashes together, it can more efficient to calculate and combine wide hash
        /// that are only reduced to a narrow uint hash at the very end instead of at every step.
        /// </summary>
        /// <param name="v">Vector value to hash.</param>
        /// <returns>uint2 hash of the argument.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static uint2 hashwide(ushort2 v)
        {
            return (asuint(v) * uint2(0xC3D32AE1u, 0xB966942Fu)) + 0xFE9856B3u;
        }

        /// <summary>Returns the result of specified shuffling of the components from two ushort2 vectors into a ushort value.</summary>
        /// <param name="left">ushort2 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">ushort2 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting ushort.</param>
        /// <returns>ushort result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort shuffle(ushort2 left, ushort2 right, ShuffleComponent x)
        {
            return select_shuffle_component(left, right, x);
        }

        /// <summary>Returns the result of specified shuffling of the components from two ushort2 vectors into a ushort2 vector.</summary>
        /// <param name="left">ushort2 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">ushort2 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting ushort2 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting ushort2 y component.</param>
        /// <returns>ushort2 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort2 shuffle(ushort2 left, ushort2 right, ShuffleComponent x, ShuffleComponent y)
        {
            return ushort2(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y));
        }

        /// <summary>Returns the result of specified shuffling of the components from two ushort2 vectors into a ushort3 vector.</summary>
        /// <param name="left">ushort2 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">ushort2 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting ushort3 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting ushort3 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting ushort3 z component.</param>
        /// <returns>ushort3 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort3 shuffle(ushort2 left, ushort2 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z)
        {
            return ushort3(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z));
