        /// <summary>Returns the result of specified shuffling of the components from two ushort2 vectors into a ushort4 vector.</summary>
        /// <param name="left">ushort2 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">ushort2 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting ushort4 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting ushort4 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting ushort4 z component.</param>
        /// <param name="w">The ShuffleComponent to use when setting the resulting ushort4 w component.</param>
        /// <returns>ushort4 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static ushort4 shuffle(ushort2 left, ushort2 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z, ShuffleComponent w)
        {
            return ushort4(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z),
                select_shuffle_component(left, right, w));
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        internal static ushort select_shuffle_component(ushort2 a, ushort2 b, ShuffleComponent component)
        {
            switch(component)
            {
                case ShuffleComponent.LeftX:
                    return a.x;
                case ShuffleComponent.LeftY:
                    return a.y;
                case ShuffleComponent.RightX:
                    return b.x;
                case ShuffleComponent.RightY:
                    return b.y;
                default:
                    throw new System.ArgumentException("Invalid shuffle component: " + component);
            }
        }

